const Contact = () => (
  <div className="p-4">
    <h2 className="text-3xl font-bold text-blue-600">Contact Me</h2>
    <p className="mt-2 text-gray-700">Email: <a href="mailto:aanya.03024@gmail.com" className="text-blue-500 underline">aanya.03024@gmail.com</a></p>
    <p className="mt-1">GitHub: <a href="https://github.com/aanyaagrawal26" target="_blank" className="text-blue-500 underline">https://github.com/aanyaagrawal26</a></p>
  </div>
);

export default Contact;
